import React from 'react';
import { Tag, DollarSign, TrendingUp, Clock, CheckCircle, Sparkles, Zap, BarChart3, AlertCircle } from 'lucide-react';

interface ProductData {
  name: string;
  brand: string;
  price: number;
  confidence: number;
}

interface ProductInfoProps {
  product: ProductData;
}

const ProductInfo: React.FC<ProductInfoProps> = ({ product }) => {
  const getRecommendationColor = (confidence: number) => {
    if (confidence >= 0.8) return 'text-green-400';
    if (confidence >= 0.6) return 'text-yellow-400';
    return 'text-red-400';
  };

  const getRecommendationIcon = (confidence: number) => {
    if (confidence >= 0.8) return <CheckCircle className="w-6 h-6 text-green-400" />;
    if (confidence >= 0.6) return <Clock className="w-6 h-6 text-yellow-400" />;
    return <AlertCircle className="w-6 h-6 text-red-400" />;
  };

  const getRecommendationText = (confidence: number) => {
    if (confidence >= 0.8) return "Excellent time to buy! This item is at a favorable price point.";
    if (confidence >= 0.6) return "Consider waiting. Prices may drop further in the coming weeks.";
    return "Prices are currently high. Wait for better deals.";
  };

  const getRecommendationBg = (confidence: number) => {
    if (confidence >= 0.8) return 'bg-gradient-to-r from-green-500/20 to-emerald-500/20 border-green-500/30';
    if (confidence >= 0.6) return 'bg-gradient-to-r from-yellow-500/20 to-orange-500/20 border-yellow-500/30';
    return 'bg-gradient-to-r from-red-500/20 to-pink-500/20 border-red-500/30';
  };

  return (
    <div className="space-y-6">
      {/* Product Header */}
      <div className="bg-gradient-to-r from-purple-500/20 to-pink-500/20 rounded-2xl p-6 border border-white/20">
        <div className="flex items-start justify-between mb-4">
          <div className="flex-1">
            <h3 className="text-2xl font-bold text-white mb-2">{product.name}</h3>
            <div className="flex items-center space-x-3">
              <div className="bg-white/20 backdrop-blur-sm px-3 py-1 rounded-full">
                <div className="flex items-center space-x-2">
                  <Tag className="w-4 h-4 text-purple-300" />
                  <span className="text-white font-medium">{product.brand}</span>
                </div>
              </div>
              <div className="bg-white/10 backdrop-blur-sm px-3 py-1 rounded-full">
                <span className="text-gray-300 text-sm">
                  {(product.confidence * 100).toFixed(0)}% Match
                </span>
              </div>
            </div>
          </div>
          <div className="bg-gradient-to-r from-green-500 to-emerald-500 p-3 rounded-2xl">
            <DollarSign className="w-6 h-6 text-white" />
          </div>
        </div>

        <div className="flex items-center space-x-4">
          <div className="text-3xl font-bold text-white">
            ${product.price.toFixed(2)}
          </div>
          <div className="flex items-center space-x-2">
            <TrendingUp className="w-5 h-5 text-green-400" />
            <span className="text-green-400 text-sm font-medium">Price tracked</span>
          </div>
        </div>
      </div>

      {/* AI Recommendation */}
      <div className={`${getRecommendationBg(product.confidence)} rounded-2xl p-6 border`}>
        <div className="flex items-start space-x-4">
          {getRecommendationIcon(product.confidence)}
          <div className="flex-1">
            <h4 className="font-bold text-white mb-2 flex items-center space-x-2">
              <Sparkles className="w-5 h-5" />
              <span>AI Recommendation</span>
            </h4>
            <p className="text-gray-200 leading-relaxed">
              {getRecommendationText(product.confidence)}
            </p>
          </div>
        </div>
      </div>

      {/* Price Analysis */}
      <div className="bg-white/5 backdrop-blur-sm rounded-2xl p-6 border border-white/10">
        <div className="flex items-center space-x-3 mb-4">
          <div className="bg-gradient-to-r from-blue-500 to-purple-500 p-2 rounded-xl">
            <BarChart3 className="w-5 h-5 text-white" />
          </div>
          <h4 className="font-bold text-white">Price Analysis</h4>
        </div>

        <div className="grid grid-cols-2 gap-4">
          <div className="bg-white/10 backdrop-blur-sm rounded-xl p-4 border border-white/10">
            <div className="flex items-center space-x-2 mb-2">
              <div className="w-2 h-2 bg-green-400 rounded-full"></div>
              <span className="text-gray-300 text-sm">Current Price</span>
            </div>
            <p className="text-white font-bold text-lg">${product.price.toFixed(2)}</p>
          </div>

          <div className="bg-white/10 backdrop-blur-sm rounded-xl p-4 border border-white/10">
            <div className="flex items-center space-x-2 mb-2">
